import { useState,useEffect } from "react";
// import data from './recepiedata.json'





function MenuComponent(){
    var[recepieList,recepiefn]=useState([])
    useEffect(()=>{
        fetch('/recepiedata.json').then((res)=>{ return res.json()})     
        .then((res)=>{
            console.log('wres...',res);
            recepiefn(res);
            console.log('recepieList...',recepieList)

        })
        .catch((err)=>console.log(err))
    },[recepieList])
    
    return (
        <div className="menuparent">
           <span className="font-24">Desserts</span>
           { recepieList.length > 0 &&
            recepieList.map((val)=>console.log(val))
           }
           
        </div>
    )
}
